import React from "react";
import { Button } from "react-native-paper";
import { useNavigation } from "@react-navigation/native";
import styled from "styled-components/native";

export type ButtonProps = {
  label: string;
  link: string;
};

const ButtonMain = styled(Button)<{ props: object; theme: object }>`
  background-color: ${(props) => props.theme.INACTIVE_COLOR};
  color: ${(props) => props.theme.FOREGROUND_COLOR};
  margin-top: 10;
  margin-bottom: 10;
`;

const ButtonStartScreen: React.FC<ButtonProps> = ({ label, link }) => {
  const navigation = useNavigation();
  return (
    <ButtonMain
      mode="contained"
      onPress={() => {
        navigation.navigate(link);
      }}
    >
      {label}
    </ButtonMain>
  );
};

export default ButtonStartScreen;
